import { Card } from 'react-bootstrap';

function Home(){
    return (
        <Card style ={{width:'18rem'}}>
            <Card.Body>
                <Card.Title> Welcome to BadBank! </Card.Title>
                <Card.Text> Let us help you with all your banking needs. </Card.Text>
            </Card.Body>
            <Card.Img variant="top" src="../Bank.png" /> 
        </Card>
    );
}

export default Home;
